import React from 'react';

const BulletPoint = (properties) => {
    if (properties.text.length == 1){
    return(
        <div className="lenovoBlack">
            <h3>{properties.header}</h3>
            <p>{properties.text[0]}</p>
        </div>
    )
    }
    else if (properties.text.length == 3){
        return(
            <div className="lenovoBlack">
                <h3>{properties.header}</h3>
                <p>{properties.text[0]}</p>
                {React.createElement(properties.text[1].type)}
                <p>{properties.text[2]}</p>
            </div>
        )
    }
    else if (properties.text.length == 5){
        return(
            <div className="lenovoBlack">
                <h3>{properties.header}</h3>
                <p>{properties.text[0]}</p>
                {React.createElement(properties.text[1].type)}
                <p>{properties.text[2]}</p>
                {React.createElement(properties.text[3].type)}
                <p>{properties.text[4]}</p>
            </div>
        )
    }
}

export default BulletPoint;
